import './input.css';

const Input = (props) =>{
     const [mewdatail , newDetail]=useState(props.datail)  ;
    
      const enterHandler = (event)=>{
           newDetail
      }

      return (
         
         <div className="detailFlex">
             <label className="Details">{props.detail}</label>
             <input className="EnterDetail" type="text" onChange={enterHandler}></input>
         </div>
         
      );
}

export default Input;
